import { Accordion, AccordionItemHeading, Acc } from "react-accessible-accordion";

const Forecast = ({data}) => {
    return  (
    <>
         <label className="title">Daily</label>
         <Accordion allowZeroExpanded>
            {data.list.splice(0, 7).map((item, idx) => (
                <AccordationItem>
                <AccordingItemHeading></AccordingItemHeading>
                <AccordingItemHeading></AccordingItemHeading>
                </AccordationItem>
            ))}
           
         </Accordion>
    </>
    )
}

export default Forecast;
